@scarletpoetics They take the moment to admire the complicated and unique appearance of the other, still listening well though. 
At his question they look to the sky in thought.
“There’s plenty of inns and hotels in the city, but if you prefer camping I know safe places yes.”

@scarletpoetics Albedo is silent while he explains himself, not appearing surprised or on edge despite having been followed for so long. 
As they listen to the vagrant they look through their things to make sure it’s all in order and when the other goes silent they offer a smile.
+

@TurbulentYaksha Good boy
[They squish his cheeks and kiss his forehead before letting go.]
How are you?

@ScholarofNoctua Albedo follows close behind, their hood up and trying to protect their head without ripping holes in it with their horns.
“I’m right here Elias. No need to yell.” 
They can’t help but smile at his excitement.

@FlLMOUT_ .
..
Well then... uh.. good luck with that I suppose.

@TurbulentYaksha Alright.. I’m not a very talkative person though so don’t be too expecting.
[Albedo summons their Isotoma and sits on it, using it to keep them from having to sit in snow and wet their dress.] 
You have a nice spot here.

@TurbulentYaksha Aw you’ll protect me from them? You’re sweet. It’d be a shame to dirty my dress red.
[Albedo smiles sweetly and continues on.]
If we’ll be close to a camp we can just go there for snacks if necessary but it should be alright.

Happy Valentine's Day Rai ❤️
I hope you enjoy these to the fullest.

@scaratwt https://t.co/AStWLmGxXm

@ScholarofNoctua Albedo is clearly startled by him entering but doesn’t dwell on his presence for long as they rummage about, their normally tidy appearance now disheveled. 
“I’m alright.” They clearly seem stressed and tired.
“Did you bring me food? You didn’t have to.”

@ScholarofNoctua Poodle moth.. that makes sense. Very cute.
[Albedo smiles as they look over Elias.] 
Yknow.. before I met you I had a experiment like my butterfly one, except I was a moth as well. It was a very similar experience.

@ScholarofNoctua Ah- you did? Really? 
[Albedo curiously looks at his back.]
Id say its not something to be embarrassed about but I remember that same embarrassment well.

@scaratwt Ah.. yes I.. I remember very clearly. 
[Albedo clears their throat before continuing like their moment of fluster didn’t happen.]
I’ll see what I can do but no promises.

@TurbulentYaksha They smile and gently mess up his hair.
“Good.. Ill take care of your wounds in a bit.” 
Albedos voice makes it clear it was less of an offer and more of a statement, he had very little choice in the matter.

@TurbulentYaksha Albedo glances down at him with another sigh. “That doesn’t mean you have to do it.”
Disapproval is heavy in their voice as they look up to the clouds.
“If you really want to fight until you pass out you can go but Im staying here.”

@scarahatesu Albedo wouldn’t have called the feeling weighing on them heavily ‘horror’ but it certainly wasn’t pleasant. 
Watching the other do as he pleased, they can’t bring themself to care about what he might do when questioned. Their question comes out without hesitation.
“Why?”

@TurbulentYaksha However, there was only so much they could watch until concern began to seep in and weigh heavy. 
Another fight ends and they force themself to interrupt as Childe cheerfully mentions moving on to find another. 
“Sit with me. You need to rest whether you realize that or not.”

@ChaoticXiao Of course of course. I told you you'd get one so it's only fair. 
[Albedo takes fogs head and squishes his cheeks as they plant a kiss to his lips.] 
Mwah

@scaratwt It means love is stored in the flower pot :)

A flower pot is just a little pot made of ceramic and filled with soil but with time you can make it a little home.

You plant a seed, and watch it grow. Make sure its healthy and give it what it needs until the pot is now a home.

// tw violence injury blood this point forward

Every wound Albedo made on this imposter in front of them, was soon paid back with wounds of their own.

Make a cut and get their own. Impale an enemy with stone and get both impaled and burned by the cruel and freezing ice.

// tw blood injury

Albedo stares down at gashes and burns on their arms and legs, honestly more annoyed by the clothes ruined by blades, fire, and blood. 

Their thoughts and actions quickly stall as they hear something approaching. Or someone.

@scaratwt [Albedo reaches out and cups his cheek, humming softly. After a moment they lean in to kiss his nose before texting again.]
✨ You have a beautiful face.
✨ did you sleep well?

@scaratwt [They hide most of their face in the pillows with a shrug, showing just enough for them to look at the screen and text.] 
✨ I don’t know.
✨ If you really want me to I’ll make myself talk though. For you.

@ScholarofNoctua They roll their eyes but smile, walking away to put their tea down and clean up their paints and such.

"You're certainly eager to flatter aren't you? Is it because of my little friend over there?" 

Albedo nods towards the terrarium.

@scaradelusion 

✨"Did you want Coffee or Tea tomorrow?" 

✨"My apologies, this looks like it might be the wrong number?"

@ScholarofNoctua Albedo hands him the cup of tea then goes to get their own which rests next to a fairly big terrarium like structure. The moth from before is in it sitting by a light. 

“You’re too kind, its far from finished.”
They move over to kiss his cheek, “also, its a real place so…”

@ScholarofNoctua They take his coat and hang it by the door, gesturing for him to follow as they head to their office like room.

“Painting, I couldn’t sleep so I figured I’d make something.” 

Inside the room Albedo goes and pours a cup of tea Elias. Next to them a unfinished landscape painting.

@kamisatoprince 

✨”Ayato.”
✨ “Aya did you know?”

@ScholarofNoctua You’re very kind. 
[Albedo breaks off a little stick from the mistletoe on their horns, holding it out to Elias as it changes and blooms to a white rose.] 
I’m disappointed that I didn’t interact with you sooner

@ScholarofNoctua My peace is from your company specifically. Most other people Id actually be rather annoyed by it to be truthful.
[They give him a smile that seems oddly playful compared to their usual look.]
You’re lucky

@ScholarofNoctua Hot chocolate, a classic and great choice. 
[Albedo takes a moment to just sketch up and create mugs of hot chocolate with snowman marshmallows. The mugs moth and dragon themed respectfully.] 
I do hope its to your liking like this, it might be a bit too sweet for some.

@ScholarofNoctua Hm..? What?
[they reach up and seem surprised by the mistletoe but they smile.]
My sister must have put those there.

@ChaoticXiao Step 1. Be nice
Step 2. Be patient
Step 3. Hope
